class Sidepanel extends React.Component {
    render(){
        return (
            <div className="col-md-3">
                <img className="logo" src="/images/JAI PARAKH (2).png"></img>
                <style jsx>{`
                    .logo{
                        height: 200px;
                        width: 200px;
                    }
                `}</style>
            </div>
        );
    }
}

export default Sidepanel;
